import React, { useState } from "react";
// import axios from 'axios';
// import { navigate } from "@reach/router";

const WorkoutForm = (props) => {
  const [name, setName] = useState(props.name);
  const [imageUrl, setImageUrl] = useState(props.imageUrl);
  const [numOfTreasureChests, setNumOfTreasureChests] = useState(
    props.numOfTreasureChests
  );
  const [catchPhrase, setCatchPhrase] = useState(props.catchPhrase);
  const [crewPosition, setCrewPosition] = useState(props.crewPosition);
  const [pegLeg, setPegLeg] = useState(props.pegLeg);
  const [eyePatch, setEyePatch] = useState(props.eyePatch);
  const [hookHand, setHookHand] = useState(props.hookHand);
  const [errors, setErrors] = useState([]);

  const handleSubmit = (e) => {
    e.preventDefault();

    setErrors([]);
  };

  return (
    <div class="container">
      {/* <div class="form-group"> */}
      <form onSubmit={handleSubmit}>
        <div className="form-group col-md-3">
          <label>Pirate Name:</label>
          <input
            type="text"
            value={name}
            name="name"
            className="form-control"
            onChange={(e) => setName(e.target.value)}
          />
        </div>
        <div className="form-group col-md-3">
          <label>Image Url:</label>
          <input
            type="text"
            value={imageUrl}
            name="imageUrl"
            className="form-control"
            onChange={(e) => setImageUrl(e.target.value)}
          />
        </div>
        <div className="form-group col-md-3">
          <label># of Treasure Chests:</label>
          <input
            type="number"
            value={numOfTreasureChests}
            className="form-control"
            onChange={(e) => setNumOfTreasureChests(e.target.value)}
          />
        </div>
        <div className="form-group col-md-3">
          <label>Pirate Catch Phrase:</label>
          <input
            type="text"
            value={catchPhrase}
            name="catchPhrase"
            className="form-control"
            onChange={(e) => setCatchPhrase(e.target.value)}
          />
        </div>
        <div className="form-group col-md-3">
          <label> Crew Position:</label>
          <select
            value={crewPosition}
            className="form-control"
            onChange={(e) => setCrewPosition(e.target.value)}
          >
            <option value="default">Please select a crew position</option>
            <option value="Captain">Captain</option>
            <option value="First Mate">First Mate</option>
            <option value="Quarter Master">Quarter Master</option>
            <option value="Boatswain">Boatswain</option>
            <option value="Powder Monkey">Powder Monkey</option>
          </select>
        </div>
        <div>
          <label>
            <input
              type="checkbox"
              checked={pegLeg}
              className="check"
              onChange={(e) => setPegLeg(e.target.checked)}
            />
            Peg Leg
          </label>
        </div>
        <div className="check">
          <label>
            <input
              type="checkbox"
              checked={eyePatch}
              onChange={(e) => setEyePatch(e.target.checked)}
            />
            Eye Patch
          </label>
        </div>
        <div className="check">
          <label>
            <input
              type="checkbox"
              checked={hookHand}
              onChange={(e) => setHookHand(e.target.checked)}
            />
            Hook Hand
          </label>
        </div>
        <input
          type="submit"
          value="Add Pirate!"
          name="submit"
          className="add-btn"
        />

        {errors.map((err, index) => (
          <h3 className="errors" key={index}>
            {" "}
            {err}
          </h3>
        ))}
      </form>
      {/* </div> */}
    </div>
  );
};

export default WorkoutForm;
